  [],\n\t\"num_tags\": 0,\n\t\"name\": \"niskin-bottle-data-of-the-hawaii-ocean-time-series-hot-program-in-the-north-pacific-100-miles-n4aeed\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The HOT program makes repeated observations
  of the physics, biology andnchemistry at a site approximately 100 km north of Oahu,
  Hawaii. Two stationsnare visited about once a month: Kahe Point (Station 1: 21.34N,
  158.27W) andnStation ALOHA (Station 2: 22.75N, 158W). Various other stations are
  madenintermittently in support of similar research objectives or mooringndeployments.nnSamples
  of water column chemical analyses were collectednmostly in the upper 1000m using
  Niskin bottles mounted on a rosette.nThe strategy was to sample at density horizons
  within the main thermoclinenat pressure horizons above and below this region (i.e.,
  <150 dbarnand >2000 dbar). Care was applied to ensure the highest possiblenaccuracy
  and precision.nnThis NODC accession contains Niskin Bottle data for HOT cruises
  239-248nduring 2012. CTD and thermosalinograph data from the same cruisesnare available
  in separate NODC accessions. Historic data for HOTnhave also been archived at NODC.\",\n\t\"owner_org\":
